import os
import numpy as np

'''
eric.g.younkin@noaa.gov, glen.rice@noaa.gov

Here we maintain vdatum specific grid listings, grid hashes, and vdatum answers that we expect to change between vdatum versions
Ideally we would use a version system that VDatum maintains, but there does not appear to be a reliable one.

##################################

To add a new VDatum version:

- get the grids from the vdatum folder

from vyperdatum.core import get_grid_list, hash_vdatum_grids

vdatum_directory = r'C:\vdatum412_20201203\vdatum'
grids, regions = get_grid_list(vdatum_directory)

1. hash the grids

hashdict = hash_vdatum_grids(grids, vdatum_directory)

2. include the sigma file hash

sigmafile = os.path.join(vdatum_directory, 'vdatum_sigma.inf')
sigma_hash = hash_vdatum_grids({'vdatum_sigma.inf': sigmafile}, vdatum_directory)

3. update this file with the hash

# use the print_formatted_dict helper function to get the formatting right
_print_formatted_dict(hashdict)
# this printed data goes into the vdatumxxx_xxxxxxxx_hashes

4. update the geoid lookup

# this is the vdatumxxx_xxxxxxxx_geoid attribute, you need to look at the release notes or some other source to figure
#   out which region is associated with which geoid

5. update the general lookups (vdatum_hashlookup, vdatum_geoidlookup)

6. update the vdatum_answers with the expected answers given from the test, you can use the Vdatum java app to do this

##################################

Notes on specific versions:
vdatum412_20201203 - first version added, we don't plan on supporting vdatum prior to this version
vdatum42_20210603 - basically identical to 412, except that the sigma file has zero'd out uncertainty values for conus navd88 nad83 transformation... 
vdatum43_20210928 - chesapeake bay region redone, all on xgeoid20b
vdatum441_20220324 - all of the west coast was redone, you'll see higher tss values, everything on xgeoid20b

'''


def _print_formatted_dict(vdatum_grid_dict: dict):
    """
    Used to build the hashes dicts seen below, so you get two entries on one line

    Parameters
    ----------
    vdatum_grid_dict
        one of vdatum412_20201203_hashes or similar
    """

    buff_ky = ''
    for ky in vdatum_grid_dict.keys():
        if not buff_ky:
            buff_ky = ky
            continue
        else:
            print('"{}": "{}", "{}": "{}",'.format(buff_ky, vdatum_grid_dict[buff_ky], ky, vdatum_grid_dict[ky]))
            buff_ky = ''
    if buff_ky:
        print('"{}": "{}"'.format(buff_ky, vdatum_grid_dict[buff_ky]))


